import React from "react";

const Enroll = () => {
    return(
        <>
        <section className="enroll">
            <div className="container">
                <div className="row">
                    <div className="col-md-12">
                        <h1>
                        Your Gateway to a Brighter Future
                        </h1>
                        <button>
                        Enroll Now
                        </button>
                    </div>
                </div>
            </div>
        </section>
        </>
    );
}

export default Enroll;
